import './App.css';
import Login from './Pages/Login';
import {Route, Routes} from 'react-router-dom'
import Button from './components/button'



function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Login/>}/>
        <Route path='/about' element={<Button/>}/>
      </Routes>
    </div>
  );
}

export default App;
